import React from 'react';
import './Css/BrandBoard.css';
import mobile from './Images/smartphone.png';
import laptop from './Images/laptop_22935.png';
import smartwatch from './Images/digital-watch_8469160.png';
import ac from './Images/air-conditioner-32-64.png';
import tv from './Images/tv-27-64.png';
import fridge from './Images/fridge-3-64.png';
import headphone from './Images/headphones-16-64.png';
import shoe from './Images/shoes.png';
import buds from './Images/earheadphones.png';
import printer from './Images/printer-78-64.png';
import beauty from './Images/beauty-care-2-64.png';
import blinkit from './Images/';



function ProductBoard() {
  const brands = [
    { id: 1, logo: mobile },
    { id: 2, logo: laptop },
    { id: 3, logo: smartwatch },
    { id: 4, logo: ac },
    { id: 5, logo: tv },
    { id: 6, logo: fridge },
    { id: 7, logo: headphone },
    { id: 8, logo: shoe },
    { id: 9, logo: buds },
    { id: 10, logo: printer },
    { id: 11, logo: beauty },
    { id: 12, logo: blinkit }
  ];

  return (
    <div className='brand-board-main'>
      <div className='brand-list-container'>
      <div id="label-title">Top Products</div>
        <div className='brand-list'>
          {brands.map(brand => (
            <div className='brand' key={brand.id}>
              <img src={brand.logo} alt={`Brand ${brand.id}`} />
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default ProductBoard;
